select w.b2, w.b1 from (select v.b1, beer, v.b2 from ((select bar b2, beer, name b1 from bar, serves) except (select name b1, beer, bar b2 from bar, serves)) v) w
except
select m.b1, m.b2 from (select v.b1, beer, v.b2 from ((select bar b2, beer, name b1 from bar, serves) except (select name b1, beer, bar b2 from bar, serves)) v) m;

select bar.name, b1.name from bar join bar as b1 on bar.name!=b1.name except (select distinct a, b from
(select serves.bar as a , s1.bar as b, serves.beer from serves join serves as s1 on serves.bar!=s1.bar except(
select serves.bar, s2.bar, s2.beer from serves join serves as s2 on serves.bar!=s2.bar)) as s3);

SELECT cro1.name, cro1.bar FROM (SELECT s.bar, s.beer, b.name FROM Bar b CROSS JOIN Serves s EXCEPT SELECT b.name, s.beer, s.bar FROM Bar b CROSS JOIN Serves s) AS cro1

EXCEPT

SELECT cro2.bar, cro2.name FROM (SELECT s.bar, s.beer, b.name FROM Bar b CROSS JOIN Serves s EXCEPT SELECT b.name, s.beer, s.bar FROM Bar b CROSS JOIN Serves s) AS cro2;

(select a.bar1, a.bar2
from 
((select distinct z.bar as bar1, y.beer as beer1, y.bar as bar2, y.beer as beer2 from (serves as z cross join serves as y)  where z.bar<>y.bar and z.beer<>y.beer) except (select distinct z.bar as bar1, y.beer as beer1, y.bar as bar2, y.beer as beer2 from (serves as z cross join serves as y)  where z.bar<>y.bar and z.beer=y.beer)) as a
)

except 

(select b.bar1, b.bar2
from 
((select distinct z.bar as bar1, z.beer as beer1, y.bar as bar2, z.beer as beer2 from (serves as z cross join serves as y)  where z.bar<>y.bar and z.beer<>y.beer) except (select distinct z.bar as bar1, y.beer as beer1, y.bar as bar2, y.beer as beer2 from (serves as z cross join serves as y)  where z.bar<>y.bar and z.beer=y.beer)) as b
);

(select a.bar2, a.bar1 
	from ( 
		(select s1.bar as bar1, s1.beer, s2.bar as bar2
			from serves s1, serves s2) 
		except 
		(select s2.bar as bar2, s1.beer, s1.bar as bar1
			from serves s1, serves s2) ) as a) 
except 
(select b.bar1, b.bar2 
	from ( 
		(select s1.bar as bar1, s1.beer, s2.bar as bar2
			from serves s1, serves s2) 
		except 
		(select s2.bar as bar2, s1.beer, s1.bar as bar1
			from serves s1, serves s2) ) as b);

select bar1, bar2 from (
select s1.bar as bar1, s1.beer as beer1, s2.bar as bar2, s2.beer as beer2 from serves as s1, serves as s2 where s1.bar != s2.bar
) as T

except

select bar1, bar2 from (
select serves.bar as bar1, bar.name as bar2, serves.beer as beer from serves, bar
except
select bar.name as bar1, serves.bar as bar2, serves.beer as beer from serves, bar
) as X;

with T(bar1, beer, bar2) as
((select s1.bar as bar1, s1.beer, s2.bar as bar2
from serves as s1, serves as s2)
except
(select s2.bar as bar2, s1.beer, s1.bar as bar1
from serves as s1, serves as s2))

(select bar2, bar1 from T)
except
(select bar1, bar2 from T);

--(j) Find all (bar1, bar2) pairs where the set of beer served at bar1 is a proper subset of those served at
--bar2; i.e., bar2 serves every beer that bar1 serves and plus some more.
(SELECT DISTINCT b1.bar, b2.bar FROM serves AS b1, serves AS b2 WHERE b1.bar <> b2.bar)

EXCEPT

(SELECT DISTINCT bars.bar, bars.name FROM (
  (SELECT a.bar, a.name, a.beer FROM (serves CROSS JOIN bar) a)
  EXCEPT
  (SELECT b.name, b.bar, b.beer FROM (serves CROSS JOIN bar) b)
) bars
);

select bar,name from serves, bar where bar<>name
	except 
	(select bar,name from 
		(select bar,name,beer from serves,bar AS barMany except 
				select name,bar,beer from serves, bar AS barMany2 
				) AS barDiff);

(select distinct s1.bar,s.bar from serves s1, serves s where s.bar<>s1.bar)
EXCEPT
(select distinct b,c from (
	(select distinct s.bar b,s1.bar c,s.beer from serves s1, serves s where s.bar<>s1.bar)
	EXCEPT
	(select distinct s1.bar b,s.bar c,s.beer from serves s1, serves s where s.bar<>s1.bar)
) foo
);

(SELECT x.bar2 AS bar2, x.bar1 AS bar1 FROM ((SELECT b.bar AS bar1, beer, a.name AS bar2 FROM (SELECT name FROM bar) AS a, (SELECT bar, beer FROM serves) AS b) EXCEPT (SELECT c.bar2, c.beer, c.bar1 FROM (SELECT b.bar AS bar1, beer, a.name AS bar2 FROM (SELECT name FROM bar) AS a, (SELECT bar, beer FROM serves) AS b) AS c)) AS x) EXCEPT (SELECT y.bar1 AS bar1, y.bar2 AS bar2 FROM ((SELECT b.bar AS bar1, beer, a.name AS bar2 FROM (SELECT name FROM bar) AS a, (SELECT bar, beer FROM serves) AS b) EXCEPT (SELECT c.bar2, c.beer, c.bar1 FROM (SELECT b.bar AS bar1, beer, a.name AS bar2 FROM (SELECT name FROM bar) AS a, (SELECT bar, beer FROM serves) AS b) AS c)) AS y);


